import ingredientsStyle from '../BurgerIngredients/BurgerIngredients.module.css'
import { data } from '../../utils/data.js'

function IngredientsList() {
    return (
    <div className={ingredientsStyle.item}>
        <img src={`${data.image}`} alt={`${data.name}`} className={ingredientsStyle.image} />
        <div><span className={`${ingredientsStyle.price} text text_type_digits-default`}>{data.price}</span><CurrencyIcon type="primary" /></div>
        <p className={`${ingredientsStyle.paragraph} text text_type_main-default`} >{data.name}</p>
        <Counter count={233} size="small" />
    </div>
    )
}

export default IngredientsList
